  return (
    <nav style={{ border: "2px solid red" }}>
      <button onClick={() => setMenuOpen(!menuOpen)}>
        {menuOpen ? "Menu Open" : "Menu Closed"}
        {/* <FontAwesomeIcon icon={faMusic} /> */}
      </button>
    </nav>
  );
}
